import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, IconButton, Typography, Button, Paper, Grid } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import '../style/HomeBis.css';

function HomeBis() {
    return (
      <div style={{ display: 'flex', flexDirection: 'column', height: '100vh' }}>
        <AppBar position="static" color="inherit" elevation={0}>
          <Toolbar>
            <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
              <IconButton edge="start" color="inherit" aria-label="home">
                <HomeIcon />
              </IconButton>
            </Link>
            <Typography variant="h6" style={{ flexGrow: 1 }}>
              {/* Placeholder for center alignment */}
            </Typography>
            <Link to="/Contact" style={{ textDecoration: 'none', color: '#B1B1B1' }}>
              <Button color="inherit" style={{ color: '#B1B1B1', textTransform: 'none'}}>Contact</Button>
            </Link>
          </Toolbar>
        </AppBar>
  
        {/* New centered text div */}
        <div style={{ flexGrow: 1, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
          <Typography variant="h4" style={{ color: '#B1B1B1' }}>Texte de pr√©sentation random</Typography>
        </div>
  
        <div style={{ flexGrow: 1 }}></div>
  
        <div style={{ padding: '0 24px' }}>
          <Grid container spacing={3} style={{ alignItems: 'flex-end' }}>
            {["/Bio", "/Projects", "/Experience"].map((route, index) => (
              <Grid item xs={4} key={index}>
                <Link to={route} style={{textDecoration: 'none'}}>
                  <Paper 
                    elevation={0} 
                    className="grid-item-paper hoverable-grid-item"
                    style={{ background: '#F4F3F1' }}
                  >
                    <Paper elevation={5} className="inner-paper" style={{ width: '70%', height: '50%', background: '#EFEFEF' }} />
                  </Paper>
                </Link>
              </Grid>
            ))}
          </Grid>
        </div>
      </div>
    );
}  

export default HomeBis;
